import React from 'react'
import './popularHotels.scss'
const PopularHotels = ({dataArray}) => {
  return (
    <div className="popularHotels">
        {dataArray.map((item,index) =>
            <div className="item" key={index}>
                <img src={item} alt="" />
            </div>
        )}
    </div>
  )
}

export default PopularHotels
